  "translationLines": [
    {
      "lineNumber": 190912,
      "originalJapaneseLine": "あなたはウズメに手を引かれて町を歩く。",
      "translatedEnglishLine": "You walk through the town, holding Uzume's hand."
    },
    {
      "lineNumber": 190913,
      "originalJapaneseLine": "ずっとウズメはにこにこと嬉しそうだった。",
      "translatedEnglishLine": "Uzume kept smiling and looked very happy."
    },
    {
      "lineNumber": 190914,
      "originalJapaneseLine": "「はあ、アイスは美味しいでござるなあ」",
      "translatedEnglishLine": "\"Ah, ice cream is delicious, isn't it?\""
    },
    {
      "lineNumber": 190915,
      "originalJapaneseLine": "「お、主君、あっちのたい焼きも",
      "translatedEnglishLine": "\"Oh, my lord, those taiyaki over there too"
    },
    {
      "lineNumber": 190916,
      "originalJapaneseLine": "　美味しそうでござるよ」",
      "translatedEnglishLine": "look delicious.\""
    },
    {
      "lineNumber": 190917,
      "originalJapaneseLine": "ウズメはとても楽しそうににこにこしていた。",
      "translatedEnglishLine": "Uzume was beaming with joy."
    },
    {
      "lineNumber": 190918,
      "originalJapaneseLine": "「主君の傍に付き従い、影から守る。",
      "translatedEnglishLine": "\"Serving close to my lord, protecting from the shadows."
    },
    {
      "lineNumber": 190919,
      "originalJapaneseLine": "　これぞ忍びというものでござるよ」",
      "translatedEnglishLine": "This is what it means to be a shinobi.\""
    },
    {
      "lineNumber": 190920,
      "originalJapaneseLine": "「今日は護衛ごっこでござるからして、",
      "translatedEnglishLine": "\"Today is playing at being a bodyguard,"
    },
    {
      "lineNumber": 190921,
      "originalJapaneseLine": "　一日、主君の一番お側にいるでござるよ〜」",
      "translatedEnglishLine": "so I will be right by my lord’s side all day long~\""
    },
    {
      "lineNumber": 190922,
      "originalJapaneseLine": "「それはもちろん！」",
      "translatedEnglishLine": "\"Of course!\""
    },
    {
      "lineNumber": 190923,
      "originalJapaneseLine": "「おおっ！？」",
      "translatedEnglishLine": "\"Oh!?\""
    },
    {
      "lineNumber": 190924,
      "originalJapaneseLine": "「い、いや、そうは言っても、",
      "translatedEnglishLine": "\"N-no, even so,"
    },
    {
      "lineNumber": 190925,
      "originalJapaneseLine": "　一緒に入ったりするわけではないでござるよ」",
      "translatedEnglishLine": "it’s not like we’re going to enter (baths) together or anything.\""
    },
    {
      "lineNumber": 190926,
      "originalJapaneseLine": "「さすがに兄弟姉妹と言っても、",
      "translatedEnglishLine": "\"Even though we are siblings,"
    },
    {
      "lineNumber": 190927,
      "originalJapaneseLine": "　えーと、なんというか、えー……」",
      "translatedEnglishLine": "uhm, how should I put it, uh...\""
    },
    {
      "lineNumber": 190928,
      "originalJapaneseLine": "「ウズメにはまだ早いでござるからして」",
      "translatedEnglishLine": "\"It’s still too early for Uzume, after all.\""
    },
    {
      "lineNumber": 190929,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 190930,
      "originalJapaneseLine": "「えーと……」",
      "translatedEnglishLine": "\"Um...\""
    },
    {
      "lineNumber": 190931,
      "originalJapaneseLine": "「とは言っても布団は別々でござるよ。",
      "translatedEnglishLine": "\"That said, we sleep in separate futons."
    },
    {
      "lineNumber": 190932,
      "originalJapaneseLine": "　うん……」",
      "translatedEnglishLine": "Yeah...\""
    },
    {
      "lineNumber": 190933,
      "originalJapaneseLine": "「う、ウズメ、さすがにそういうのは、",
      "translatedEnglishLine": "\"U-Uzume, that kind of thing really makes me embarrassed...\""
    },
    {
      "lineNumber": 190934,
      "originalJapaneseLine": "　照れてしまうでござるからして……」",
      "translatedEnglishLine": "\"Because it makes me shy...\""
    },
    {
      "lineNumber": 190935,
      "originalJapaneseLine": "ウズメは顔を耳まで真っ赤に染めていた。",
      "translatedEnglishLine": "Uzume’s face was flushed bright red up to her ears."
    },
    {
      "lineNumber": 190936,
      "originalJapaneseLine": "あなたはウズメと一日、楽しく町を見て回り、",
      "translatedEnglishLine": "You spent the day happily walking around town with Uzume,"
    },
    {
      "lineNumber": 190937,
      "originalJapaneseLine": "後でナギに仲がいいねとからかわれるのだった。",
      "translatedEnglishLine": "and later Nagi teased you about how close you two were."
    },
    {
      "lineNumber": 190938,
      "originalJapaneseLine": "なんとなく、ウズメと、",
      "translatedEnglishLine": "Somehow, with Uzume,"
    },
    {
      "lineNumber": 190939,
      "originalJapaneseLine": "より深く仲良くなれた気がした。",
      "translatedEnglishLine": "you felt like you became even closer."
    },
    {
      "lineNumber": 190940,
      "originalJapaneseLine": "「俺様に従え！」",
      "translatedEnglishLine": "\"Obey me!\""
    },
    {
      "lineNumber": 190941,
      "originalJapaneseLine": "「お邪魔しまーす。",
      "translatedEnglishLine": "\"Excuse me for disturbing you."
    },
    {
      "lineNumber": 190942,
      "originalJapaneseLine": "　＜エール＞ちゃん、晩ご飯が出来たから、",
      "translatedEnglishLine": "\"<Yell>–chan, dinner’s ready,"
    },
    {
      "lineNumber": 190943,
      "originalJapaneseLine": "　ザンスちゃん呼んできてくれないかな？」",
      "translatedEnglishLine": "could you please call Zansu–chan?\""
    },
    {
      "lineNumber": 190944,
      "originalJapaneseLine": "――と、リセットに頼まれたあなたは、",
      "translatedEnglishLine": "—so, having been asked by Reset,"
    },
    {
      "lineNumber": 190945,
      "originalJapaneseLine": "ザンスを探して近くの川まで来ていた。",
      "translatedEnglishLine": "you came to a nearby river to find Zansu."
    },
    {
      "lineNumber": 190946,
      "originalJapaneseLine": "「……アア？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 190947,
      "originalJapaneseLine": "「げっ、何しに来やがった……」",
      "translatedEnglishLine": "\"Ugh, what the hell are you here for...\""
    },
    {
      "lineNumber": 190948,
      "originalJapaneseLine": "川辺を少し歩くと、",
      "translatedEnglishLine": "Walking along the riverside a little,"
    },
    {
      "lineNumber": 190949,
      "originalJapaneseLine": "剣を構えているザンスがすぐに見つかった。",
      "translatedEnglishLine": "you quickly found Zansu holding a sword ready."
    },
    {
      "lineNumber": 190950,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 190951,
      "originalJapaneseLine": "「アア？　なにしてるかって？",
      "translatedEnglishLine": "\"Huh? What am I doing?"
    },
    {
      "lineNumber": 190952,
      "originalJapaneseLine": "　ちっ、まあ隠しても意味ねーしな」",
      "translatedEnglishLine": "Tch, well, there's no point hiding it anyway.\""
    },
    {
      "lineNumber": 190953,
      "originalJapaneseLine": "「見ての通り、しゅぎょーだよ、修行」",
      "translatedEnglishLine": "\"As you can see, training, training.\""
    },
    {
      "lineNumber": 190954,
      "originalJapaneseLine": "「一日の遅れを取り戻すには三日かかる。",
      "translatedEnglishLine": "\"It takes three days to catch up on one day missed."
    },
    {
      "lineNumber": 190955,
      "originalJapaneseLine": "　基本的には毎日やってんぞ。",
      "translatedEnglishLine": "Basically, I do it every day."
    },
    {
      "lineNumber": 190956,
      "originalJapaneseLine": "　ま、人前ではそーそーやらねーがな」",
      "translatedEnglishLine": "Well, I don’t usually do it around people, though.\""
    },
    {
      "lineNumber": 190957,
      "originalJapaneseLine": "「ハンッ、最強の俺も修行すんのかって驚いたか」",
      "translatedEnglishLine": "\"Hmph, surprised that even the strongest me trains?\""
    },
    {
      "lineNumber": 190958,
      "originalJapaneseLine": "「俺の師匠がその辺くそ真面目でな。",
      "translatedEnglishLine": "\"My master is really seriously strict."
    },
    {
      "lineNumber": 190959,
      "originalJapaneseLine": "　人生を剣に捧げたみたいな奴でよ、",
      "translatedEnglishLine": "He’s the kind of guy who seems to have dedicated his life to the sword."
    },
    {
      "lineNumber": 190960,
      "originalJapaneseLine": "　剣術に関しちゃ厳しく躾けられてんだ」",
      "translatedEnglishLine": "When it comes to swordsmanship, he's trained me very strictly.\""
    },
    {
      "lineNumber": 190961,
      "originalJapaneseLine": "「最強になるには人よりも多く、",
      "translatedEnglishLine": "\"To become the strongest, you have to swing your sword more times than others,"
    },
    {
      "lineNumber": 190962,
      "originalJapaneseLine": "　一度でも多く剣を振れってな」",
      "translatedEnglishLine": "even if just once more.\""
    },
    {
      "lineNumber": 190963,
      "originalJapaneseLine": "「つっても、人に物教えるセンスは",
      "translatedEnglishLine": "\"That said, his sense of teaching is"
    },
    {
      "lineNumber": 190964,
      "originalJapaneseLine": "　壊滅的な師匠だったから、",
      "translatedEnglishLine": "totally disastrous,"
    },
    {
      "lineNumber": 190965,
      "originalJapaneseLine": "　ほとんど見て盗んだだけだがな」",
      "translatedEnglishLine": "so I mostly just observed and learned on my own.\""
    },
    {
      "lineNumber": 190966,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 190967,
      "originalJapaneseLine": "「もし今後会う機会があっても、",
      "translatedEnglishLine": "\"Even if you have a chance to meet him later,"
    },
    {
      "lineNumber": 190968,
      "originalJapaneseLine": "　俺がそいつを師匠と呼んでたなんて言うなよ」",
      "translatedEnglishLine": "don’t say that I called that guy my master.\""
    },
    {
      "lineNumber": 190969,
      "originalJapaneseLine": "「……ぜってー、泣いて喜ぶからうぜえ」",
      "translatedEnglishLine": "\"He'd definitely cry tears of joy and that would be annoying.\""
    },
    {
      "lineNumber": 190970,
      "originalJapaneseLine": "どうやら、その師匠とは複雑な関係であるらしい。",
      "translatedEnglishLine": "Apparently, his relationship with that master is complicated."
    },
    {
      "lineNumber": 190971,
      "originalJapaneseLine": "「まあいいや。",
      "translatedEnglishLine": "\"Well, whatever."
    }
  ]
}

